var ip = 0;
var printing = false;

function nand(a, b){
	return ~(a & b);
}

function m_vrun(input_buffer){
	if (ip == 0) {
		input_buffer = '';
	}
	input_buffer = input_buffer.split('');
	input_buffer.reverse();
	var output_buffer = '';
	while(true){
		if (ip >= m_mem.length) { output_buffer += '\n\nPress (Enter) to reload.'; break; }
		var a = m_mem[ip++];
		var b = m_mem[ip++];
		if (a <= 0) {
			if (b >= 0) { 
				ip = b;
				continue;
			}
			else {
				var c = m_mem[ip++];
				output_buffer += String.fromCharCode(m_mem[c]);
			}
		}
		else {
			if (b < 0) { 
				if (input_buffer.length == 0) {
					ip -= 2;
					break;
				}
				m_mem[a] = input_buffer.pop().charCodeAt(0);
			}
			else { 
				var c = m_mem[ip++];
				if (c >= 0) {
					m_mem[c] = nand(m_mem[a], m_mem[b]);
				}
			}
		}
	}
	return output_buffer;
}


function sleep(ms) {
	return new Promise(resolve => setTimeout(resolve, ms));
}

function interpreter(container, focus) {
	var terminal = $(container).append('<div id="myterminal"></div>').find('div:last');
	var output_span = terminal.append('<span></span>').find('span:last');
	var form = terminal.append('<form id="myform" onsubmit="return false; " autocomplete="off"></form>').find('form:last');
	var input = form.append('<input id="myinput" type="text" name="prompt" />').find('input:last');
	var output = async function(text, f_sleep=false) {
		printing = true;
		text = $('<span></span>').text(text).html();
		text_printing = '';
		output_span.append('<pre></pre>');
		old_output_span = output_span;
		for (var i = 0;i < text.length; i++){
			text_printing += text[i];
			output_span[0].lastChild.innerHTML = (text_printing)
			if(f_sleep) await sleep(50);
		}
		printing = false;
	};
	form.submit(function() {
		if (printing) return;
		if(ip >= m_mem.length) {
			location.reload();
		}

		var val = $.trim(input.val()) + '\n';
		form.hide();
		output(val);
		output(m_vrun(val), true);
		form.show();
		input.val('').focus();
	});
	$(document).ready(function() {
		$(container).mouseup(function() {
			if (document.getSelection() == '') {
				input.focus();
			}
		});
		output(m_vrun(), true);
		if (focus) {
			input.focus();
		}
	});
}
